import React, { useState } from 'react'
import '../css/List.css'

function List() {
    const [list, setList] = useState(123)

    return (
        <div>
            {
                this.state.arr.map((item, index) => {
                    return (
                        <div className="list_main" key={index}>{item}</div>
                    )
                })
            }
            <h2>{list}</h2>
        </div>
    )
}

export default List
